import React from "react";
import { Link } from "react-router-dom";
import "./Home.css";
import dairyImage from "../assets/dairy.jpg";

const Home = () => {
  return (
    <div className="home-container">
      {/* Navbar */}
      <nav className="navbar">
        <div className="logo">üêÑ Dairy Farm</div>
        <ul className="nav-links">
          <li><Link to="/">Home</Link></li>
          <li><Link to="/buy">Buy Milk</Link></li>
          <li><Link to="/orders">Orders</Link></li>
          <li className="dropdown">
            <span>User ‚ñº</span>
            <ul className="dropdown-menu">
              <li><Link to="/login">Login</Link></li>
              <li><Link to="/register">Register</Link></li>
            </ul>
          </li>
        </ul>
        <div className="nav-cta">
          <Link to="/buy" className="btn btn-primary">Order Now</Link>
        </div>
      </nav>

      {/* Hero Section */}
      <div
        className="hero"
        style={{
          backgroundImage: `url(${dairyImage})`,
        }}
      >
        <div className="overlay">
          <h2>Fresh Dairy Products Delivered to Your Doorstep</h2>
          <p>100% Organic. Farm Fresh. Taste the Purity.</p>
          <div className="hero-buttons">
            <Link to="/buy" className="btn btn-primary">Shop Now</Link>
            <Link to="/orders" className="btn btn-secondary">Track Orders</Link>
          </div>
        </div>
      </div>

      {/* Footer */}
      <footer className="footer">
        <p>¬© 2025 Dairy Farm | Freshness You Can Trust</p>
      </footer>
    </div>
  );
};

export default Home;
